import time
class Solution(object):
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        l = list(s)
        leng = 1
        for i in range(1,len(l)):
            for j in range(i,0,-1):
                lenTem = i - j
                if l[j] == l[i] and leng < lenTem:
                    leng = lenTem
        return leng

